class Case(models.Model):
    object_id = models.IntegerField(primary_key=True)
    province_state = models.CharField(max_length=100, null=True)
    country_region = models.CharField(max_length=100, null=True)
    last_update = models.CharField(max_length=100, null=True)
    lat = models.FloatField(null=True)
    long = models.FloatField(null=True)
    confirmed = models.IntegerField(null=True)
    deaths = models.IntegerField(null=True)
    recovered = models.IntegerField(null=True)

    class Meta:
        ordering = ['object_id', ]
        verbose_name = _('case')
        verbose_name_plural = _('cases')

    def __str__(self):
        return self.title

    @property
    def title(self):
        if self.province_state:
            return self.province_state_confirmed()
        else:
            return self.country_region_confirmed()

    def country_region_confirmed(self):
        return "{} - {}".format(self.country_region, self.confirmed)

    def province_state_confirmed(self):
        return "{} - {} - {}".format(self.country_region, self.province_state, self.confirmed)

